      out.write("        <div class=\"col-xs-9\">\r\n");
      out.write("            <h2 id=\"section-1\" style=\"text-align: center\">贯穿式大屏吸睛 科技范儿十足</h2>\r\n");
      out.write("            <p><br/><br/>&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp2018年12月29日，江西大乘汽车科技产业园项目正式竣工，首批大乘汽车G60S在众多领导嘉宾以及100多家行业媒体的见证下，正式投产下线。凭借靓丽的外观和越级科技配置，大乘G60S甫一出场即引发强烈关注。<br/><br/></p>\r\n");
      out.write("            <img class=\"img\" src=\"");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${path}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null, false));
      out.write("/img/two/41.jpg\"/>\r\n");
      out.write("            <p><br/><br/>&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp此次下线的G60S定位于紧凑型SUV，是大乘汽车基于全面的市场调研分析，根据最新的汽车发展潮流，面向移动智能时代的年轻消费者推出的战略产品。G60S的外观设计运用了前卫科技的星际概念，搭载了豪华品牌上才得以见到的贯穿式大屏和一系列前沿的智能科技配置，相信上市后将成为代表紧凑型SUV前沿科技的车型。<br/><br/></p>\r\n");
      out.write("            <img class=\"img\" src=\"");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${path}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null, false));
      out.write("/img/two/42.jpg\"/>\r\n");
      out.write("            <p><br/><br/>&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp大乘汽车G60S外观整体大气简洁，线条硬朗，前脸采用较为夸张的进气格栅，使新车车头更具辨识度，未来感十足。侧面腰线采取了由前大灯延伸至后尾灯组的贯穿式设计，更添时尚动感。最引人瞩目的仪表台和中控台采用了贯穿式设计，搭配多色氛围灯，使得车内科技感十足，更加炫酷。<br/><br/></p>\r\n");
      out.write("            <img class=\"img\" src=\"");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${path}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null, false));
      out.write("/img/two/43.jpg\"/>\r\n");
      out.write("            <p><br/><br/>&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp除了远程控制、手机无线充电等一系列智能科技配置，G60S将搭载大乘汽车自主联合研发的新一代的智能互联系统，具有更强的语言识别度和更丰富的信息娱乐功能。<br/><br/></p>\r\n");
      out.write("\r\n");
      out.write("            <hr>\r\n");
      out.write("            <h2 id=\"section-2\" style=\"text-align: center\">智能制造新标准 四大工艺领先</h2>\r\n");
      out.write("            <p><br/><br/>&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp同期竣工的江西大乘汽车科技产业园，是大乘汽车对标国际工业4.0先进标准，融入信息化、智能化、自动化等众多先进技术，集研发、生产、销售为一体的复合型、高科技产业园区。对提升抚州乃至江西汽车制造水平、关键零部件生产研发能力以及升级生产工艺、质量，实现产业升级都具有重要作用。<br/><br/></p>\r\n");
      out.write("            <img class=\"img\" src=\"");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${path}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null, false));
      out.write("/img/two/44.jpg\"/>\r\n");
      out.write("            <p><br/><br/>&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp产业园的冲压、车身、涂装和总装四大工厂，采用业内领先的ABB自动化集成系统、智能物联网系统、射频技术等国际先进的自动化制造装备，实现高度自动化、柔性化、智能化生产。<br/><br/></p>\r\n");
      out.write("            <img class=\"img\" src=\"");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${path}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null, false));
      out.write("/img/two/45.jpg\"/>\r\n");
